goog.provide("goog.resultTest");goog.setTestOnly("goog.resultTest");goog.require("goog.result");goog.require("goog.testing.jsunit");function testSuccessfulResult(){var value="some-value",result=goog.result.successfulResult(value);assertEquals(goog.result.Result.State.SUCCESS,result.getState());assertEquals(value,result.getValue())}function testFailedResult(){var error=new Error("something-failed"),result=goog.result.failedResult(error);assertEquals(goog.result.Result.State.ERROR,result.getState());assertEquals(error,result.getError())}function testCanceledResult(){var result=goog.result.canceledResult();assertEquals(goog.result.Result.State.ERROR,result.getState());var error=result.getError();assertTrue(error instanceof goog.result.Result.CancelError)}